import React from 'react';
import Profile from "./Profile";
import axios from "axios";
import {connect} from "react-redux";
import {
    ProfileThunk,
    ProfileThunkStatus,
    SetUsersProfile,
    UpdateProfileThunkStatus
} from "../../Readux/Reducer-Profile";
import {Navigate, useParams} from "react-router-dom";
import {WithAuthContainer} from "../../HOC/AuthHOC";
import {compose} from "redux";


const withRouter = WrappedComponent => props => {

    const params = useParams();
    return (
        <WrappedComponent
            {...props}
            params={params}
        />
    );
};

class ProfileContainer extends React.Component {
    componentDidMount() {
        console.log(this.props)
        let userid = this.props.params.userId
        if(!userid){
            userid = 2
        }
        this.props.ProfileThunk(22189)
        this.props.ProfileThunkStatus(22189)
    }

    render() {
        return <div>
            <Profile {...this.props} profile={this.props.profile} UpdateProfileThunkStatus={this.props.UpdateProfileThunkStatus} ProfileThunkStatus={this.props.ProfileThunkStatus}/>
        </div>
    }
}

let mapStateToProps = (state) => ({
    profile: state.ProfilePage.profile,
    profilestatus: state.ProfilePage.profilestatus

})

//const ProfileContainerwithRouter = withRouter(RedirectComponent)
export default compose(connect(mapStateToProps, {ProfileThunk,ProfileThunkStatus,UpdateProfileThunkStatus}),
    withRouter
    )(ProfileContainer)
